import React from 'react';
import './styles/main.scss';
import Header from './components/core/header/Header';
import LeftSidebar from './components/core/sidebar/LeftSidebar';
import RightSidebar from './components/core/sidebar/RightSidebar';
import Footer from './components/core/footer/Footer';
import Dashboard from './pages/Dashboard';
import { Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import EcomDashboard from './pages/EcomDashboard';
import Login from './pages/auth/Login';

function App() {
  return (
    <div id="wrapper">
      <Header />
      {/* <LeftSidebar /> */}

      {/* Page Content Start */}
      <div className="content-page">
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/admin" element={<LeftSidebar />} >
            <Route index element={<Dashboard />} />
          </Route>
          {/* <Route path="/shas-market" element={<EcomDashboard />} /> */}
        </Routes>
      </Router>
      <Footer />
      </div>
      {/* Page Content End */}
      <RightSidebar />

      <div className="rightbar-overlay"></div>
    </div>
  );
}

export default App;
